graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "source" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>source</b> <i>@style("stroke: red; stroke-width: 4px")</i></td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "target" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>target</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "source" -> "target" [label="on=error", labelOverlay="75%", labelhref="#srcLineTBD"];
  "source" -> "target" [label="on=success", labelOverlay="75%", labelhref="#srcLineTBD"];
  "source" -> "target" [label="timeout=5000", labelOverlay="75%", labelhref="#srcLineTBD"];
}
